//ANTES DA ORDENAÇÃO
void exibir(int V[], int n){
    int i;
    for(i=0; i<10000; i++){
        printf("%.2d ", V[i]);
    }
    printf("\n");
}

//TROCAS E COMPARAÇÕES
void ordenar_insertion(int V[], int n){
    int i, j, aux, trocas=0, compara=0;

    for(i=1; i<n; i++){
        j = i;
        compara++;

        //PARA CRESCENTE: <
        //PARA DECRESCENTE: >
        while(j > 0 && V[j] < V[j-1]){
          if (V[j - 1] > V[j]){
              compara++;
            }

            aux = V[j];
            V[j] = V[j-1];
            V[j-1] = aux;
            j--;
            trocas++;
        }
    }

    printf("%s", GREEN);
    printf("\nTotal de Trocas: ");
    printf("%.2d \n", trocas);

    printf("Total de Comparações: ");
    printf("%.2d \n", compara);
    printf("%s", WHITE);
}

//METODO MAIN
int main(void) {
    int i;

    printf("\nAntes da Ordenação: \n");
    for(i=0; i<10000; i++){
        printf("%.2d ", sorteio[i]);
    }

    clock_t begin=clock(); //INICIO
    printf("\n\nExibir as trocas da ordenação:\n");
    ordenar_insertion(sorteio, 10000);
    clock_t end=clock(); //FINAL

    printf("\nDepois da Ordenação: \n");
    for(i=0; i<10000; i++){
        printf("%.2d ", sorteio[i]);
    }

    //TEMPO DE EXECUÇÃO
    printf("\n\n");
    printf("%s", GREEN);
    printf("Tempo: %lf Segundos",(double)(end-begin) / CLOCKS_PER_SEC);
    printf("%s", WHITE);

    return 0;
}
